import React from "react";

import "./HistoryPanel.css";

const HistoryPanel = (commandListObjs) => {
    console.log(commandListObjs.type);
  return (
    <div className="HistoryPanel">
        {
            commandListObjs.map(
                (obj) => {
                    return (
                        <div className="CommandObj">
                            <p> {commandListObjs.commandName} </p>
                        </div>
                    )
                }
            )
        }
    </div>
  );
};

export default HistoryPanel;
